import math

class Solution:
    def gcdSort(self, a: List[int]) -> bool:
        N = len(a)
        p = list(range(N))
        w = [1] * N

        # utime = [0]

        def find(root):
            while root != p[root]:
                root = p[root] = p[p[root]]
            return root


        def union(a1, a2):
            # if p[a1] == p[a2]:
            #     return

            p1 = find(a1)
            p2 = find(a2)
            if p1 == p2:
                return

            # utime[0] += 1

            if w[p1] < w[p2]:
                p[p1] = p2
                w[p2] += w[p1]
            else:
                p[p2] = p1
                w[p1] += w[p2]

        for i in range(N - 1):
            for j in range(i + 1, N):
                if p[i] == p[j]:
                    continue
                #
                if math.gcd(a[i], a[j]) != 1:
                    union(i, j)
                    # print(i, j)
                    # print(p)

        b = [(a[i], i) for i in range(N)]
        b.sort()

        new_pos = [0] * N
        for i, (_, pos) in enumerate(b):
            new_pos[pos] = i

        for i in range(N):
            if find(i) != find(new_pos[i]):
                return False

        # print(utime[0])
        return True

